def count(text, k, t):
  d = dict()
  for i in range(len(text)-k+1):
    p = text[i:i+k]
    if p in d.keys():
      d[p] += 1
    else:
      d[p] = 1
  ans = []
  for x in d:
    if d[x] >= t:
      ans.append(x)
  return ans

text = ""
k, L, t = 9, 506, 20
n = len(text)
final_ans = []
for i in range(n-L+1):
  small_text = text[i:i+L]
  final_ans = final_ans + count(small_text, k, t)

d = {}
for p in final_ans:
  if p in d.keys():
    d[p] += 1
  else:
    d[p] = 1

ans = []
for k in d:
  ans.append(k)
for x in ans:
  print(x, end=" ")
